import time
s = ''
s = s.upper()
consonants,vowels = set(),set()
kevintot,stuarttot = 0,0

for x in s:
	if x not in 'AEIOU':
		consonants.add(x)
	else:
		vowels.add(x)

start_time = time.time()

for b in range(0,len(s)):
	for i in range(1,len(s)+1):
		if s[b:i]!="":
			ls = s[b:i]
			for let in vowels:
				if ls.startswith(let):
					kevintot = kevintot + 1
			for let in consonants:
				if ls.startswith(let):
					stuarttot += 1
if kevintot>stuarttot:
	print ('Kevin {}'.format(kevintot))
elif stuarttot>kevintot:
	print ('Stuart {}'.format(stuarttot))
else:
	print ('Draw')
print("--- %s seconds ---" % (time.time() - start_time))
files = open('time.txt','r')
old = files.readline()
new = time.time() - start_time
old = float(old)
diff = new - old
print (diff)
files.close()


files = open('time.txt','w')
files.write(str(new))
files.close()
